void PrivateDict::LoadDefault()
{
   unsigned int i = 0;
   DICT_ENTRY n = DICOMV3DataDict[i];
   while( n.name != 0 )
   {
//   if( n.group % 2 != 0 )
     {
     assert( n.owner != 0 );
     assert( n.group % 2 != 0 || n.group == 0xffff );
     PrivateTag t(n.group, n.element,n.owner);
     DictEntry e( n.name, n.vr, n.vm, n.ret );
     AddDictEntry( t, e );
     }
   n = DICOMV3DataDict[++i];
   }
}

